features.script:
let item = parcel.getFeatureById('item');
let objectOne = parcel.getFeatureById('objectOne');
let objectTwo = parcel.getFeatureById('objectTwo');
let vessel = parcel.getFeatureById('vessel');

let isDead = parcel.getFeatureById('isDead');
let gameActive = parcel.getFeatureById('gameActive');
let objectOneActive = parcel.getFeatureById('objectOneActive');
let objectTwoActive = parcel.getFeatureById('objectTwoActive');
let startGameL = parcel.getFeatureById('startGameL');
let startGameR = parcel.getFeatureById('startGameR');

let time = parcel.getFeatureById('time');
let scoreDisplay = parcel.getFeatureById('scoreDisplay');
let itemSound = parcel.getFeatureById('itemSound');
let gameOverSound = parcel.getFeatureById('gameOverSound');
let explosionSound = parcel.getFeatureById('explosionSound');
let gameStartSound = parcel.getFeatureById('gameStartSound');

parcel.on('playerenter', (e)=> {
	if(!milsecInterval){ 
		currentTotalMilsec = 0;
		milsecPassed = 0; 
		secPassed = 0; 
		milsecInterval= setInterval(updateTime, 1) 
	}

	var milsecInterval;
	var secPassed = 0;
	var milsecPassed = 0;
	var currentTotalMilsec = 0;
	var score = 0;

	var orgItemPos;
	var orgObjectOnePos;
	var orgObjectTwoPos;

	item.set({'proximityToTrigger': 1 });
	objectOne.set({'proximityToTrigger': 1 });
	objectTwo.set({'proximityToTrigger': 1 });

	startGameL.on('trigger', (ee)=> { 
		if(gameActive._content.text == "false"){
			gameStartSound.play();
			isDead.set({ text: "false"});
			gameActive.set({ text: "true"});
			item.position.set(0, 0, 0);
			objectOne.position.set(0, 0, 0);
			objectTwo.position.set(0, 0, 0);
			secPassed = 0;
			milsecPassed = 0;
			currentTotalMilsec = 0;	
			score = 0;	
			scoreDisplay.set({ text: "0" });
			nextItem();
			nextObject();
		}
	});
	startGameR.on('trigger', (ee)=> { 
		if(gameActive._content.text == "false"){
			gameStartSound.play();
			isDead.set({ text: "false"});
			gameActive.set({ text: "true"});
			item.position.set(0, 0, 0);
			objectOne.position.set(0, 0, 0);
			objectTwo.position.set(0, 0, 0);
			secPassed = 0;
			milsecPassed = 0;
			currentTotalMilsec = 0;		
			score = 0;	
			scoreDisplay.set({ text: "0" });
			nextItem();	
			nextObject();			
		}		
	});

	item.on('trigger', (ee)=> { 
		itemSound.play();
		e.player.emote('ðŸ’¯');
		score = score + 100;
		scoreDisplay.set({ text: score.toString() });	
		nextItem();		
	});

	objectOne.on('trigger', (ee)=> { 
		explosionSound.play();
		e.player.emote('ðŸ”¥');	
		gameOverSound.play();
		resetGame();
	});

	objectTwo.on('trigger', (ee)=> { 
		explosionSound.play();
		e.player.emote('ðŸ”¥');	
		gameOverSound.play();
		resetGame();
	});

	e.player.on('move', (ee)=> { 
		console.log("ee.player: ", ee);
		if(gameActive._content.text == "true" && isDead._content.text == "false") {
			vessel.position.set(ee.position[0] - 0.1, ee.position[1] - 0.8, ee.position[2]);
		}
	});

	function updateTime(){   
		currentTotalMilsec ++;

		if(gameActive._content.text == "true" && isDead._content.text == "false"){			
			if(item.position.x < 16) {
				item.position.set(orgItemPos.x + 0.25, orgItemPos.y, orgItemPos.z);
			}
			if(item.position.x >= 16) {
				gameOverSound.play();
				resetGame();
			}

			if(objectOneActive._content.text == "true"){
				if(objectOne.position.x < 16) {
					objectOne.position.set(orgObjectOnePos.x + 0.2, orgObjectOnePos.y, orgObjectOnePos.z);
				}
				if(objectOne.position.x >= 16){
					objectOneActive.set({ text: "false"});
				}
			}
			if(objectTwoActive._content.text == "true"){
				if(objectTwo.position.x < 16) {
					objectTwo.position.set(orgObjectTwoPos.x + 0.2, orgObjectTwoPos.y, orgObjectTwoPos.z);
				}
				if(objectTwo.position.x >= 16){
					objectTwoActive.set({ text: "false"});
				}
			}
		}

		if(milsecPassed > 30){
			secPassed++;				

			if(gameActive._content.text == "true" && isDead._content.text == "false"){
				time.set({ text: secPassed.toString() });
			}	

			milsecPassed = 0;
		} else {
			milsecPassed++;
		}
    }

	function resetGame() {
		isDead.set({ text: "true"});
		gameActive.set({ text: "false"});	
		vessel.position.set(0, 0, 0);		
		item.position.set(0, 0, 0);
		objectOne.position.set(0, 0, 0);
		objectTwo.position.set(0, 0, 0);
		secPassed = 0;
		milsecPassed = 0;
		currentTotalMilsec = 0;	
		objectOneActive.set({ text: "false"});		
		objectTwoActive.set({ text: "false"});
	}

	function nextItem() {
		var x = -13;
		var y = Math.floor(Math.random() * 3);
		var z = Math.floor(Math.random() * 5);		

		if(y == 0){y = 1.6}
		if(y == 1){y = 1.8}
		if(y == 2){y = 2}

		if(z == 0){z = -.8}
		if(z == 1){z = -0.3}
		if(z == 2){z = .2}
		if(z == 3){z = 0.7}
		if(z == 4){z = 1.2}
		if(z == 5){z = 1.7}

		orgItemPos = item.position;

		item.position.set(x, y, z);

		setTimeout(function() {
		  nextObject();		  
		}, 1500);
	}

	function nextObject() {	
		var x = -13;
		var y = Math.floor(Math.random() * 3);
		var z = Math.floor(Math.random() * 5);		

		if(y == 0){y = 1.6}
		if(y == 1){y = 1.8}
		if(y == 2){y = 2}

		if(z == 0){z = -.8}
		if(z == 1){z = -0.3}
		if(z == 2){z = .2}
		if(z == 3){z = 0.7}
		if(z == 4){z = 1.2}
		if(z == 5){z = 1.7}

		if(objectOneActive._content.text == "false"){
			orgObjectOnePos = objectOne.position;		
			objectOne.position.set(x, y, z);
			objectOneActive.set({ text: "true"});
		} else {
			orgObjectTwoPos = objectTwo.position;		
			objectTwo.position.set(x, y, z);
			objectTwoActive.set({ text: "true"});
		}
	}
});
